arguments.schema:
{
  "type": "object", 
  "title": "Member",
  "description": "Represents a member with personal information and hobbies",
  "properties": {
    "id": {
      "type": "string",
      "format": "uuid",
      "description": "Member's unique identifier"
    },
    "name": {
      "type": "string",
      "description": "Member's name"
    },
    "email": {
      "type": "string",
      "format": "email",
      "description": "Member's email address"
    },
    "age": {
      "type": "number",
      "minimum": 20,
      "exclusiveMaximum": 100,
      "description": "Member's age (must be at least 20 and less than 100)"
    },
    "hobbies": {
      "type": "array",
      "items": {
        "type": "object",
        "properties": {
          "id": {
            "type": "string",
            "format": "uuid",
            "description": "Hobby's unique identifier"
          },
          "name": {
            "type": "string",
            "description": "Hobby name" 
          }
        },
        "required": ["id", "name"]
      },
      "description": "List of member's hobbies"
    },
    "created_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp when the member was created"
    },
    "updated_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp when the member was last updated"
    },
    "deleted_at": {
      "oneOf": [
        {
          "type": "null"
        },
        {
          "type": "string",
          "format": "date-time"
        }
      ],
      "description": "Timestamp when the member was deleted, or null if not deleted"
    }
  },
  "required": ["id", "name", "email", "age", "hobbies", "created_at", "updated_at", "deleted_at"]
}

